        "quotes": [
          "If the battlements are carried, throw all your strength there. Such an advantage is allways darely won.",
          "Walls can't dodge!",
          "The softest part of a castle is the belly of the man inside.",
          "The gods have seen fit to populate the Old World with all manner of foul monsters. They've also seen fit to grant me with a keen eye and a strong bow to hunt them with.",
          "Grimgor iz da best!",
          "The only good stunty is a dead stunty, and the only thing better than a dead stunty is a dyin' stunty who tells yer where to find 'is mates.",
          "Stamp and trample! Gore and crush!",
          "Then came one they called Gibberkin. No fouler thing have I ever witnessed.",
          "Tear down their totems, befoul their colours! Kill the kings and burn the priests! Into the mud with them, break their skulls and eat their hearts!",
          "Their walls will fall. Their faith will fail. Their flesh will tear.",
          "Manling coins are like their words: never trust them. Use your weighing scales and keep your axe handy!",
          "No Rest until the Blood of Greenskins flows like Dark Ale upon the Earth!",
          "We are the chosen of Asuryan, beloved of the gods and heirs to the world. Our armies are the finest in creation; swift where our foes are lumbering, cultured where they are barbaric. Give no thought to failure, nor defeat – we are the Children of Ulthuan and we shall prevail.",
          "Before Elves, before Dwarfs, before Men, the Old Ones arrived upon this world. Then came Chaos and the Great Plan of the Old Ones was unmade. We are the last of their servants, and only by our hand shall the Great Plan be restored, with the total defeat of the usurping younger races.",
          "At the time of the three hundredth cycle of this world, the two moons shall unite and summon forth the Rodent God and his evil spawn to deliver plague and pestilence upon the land named Lustria",
          "The more we study our inner light, the more profound becomes the outer darkness.",
          "There is wisdom and there is ignorance, and in between are the gateways to eternity through which the Old Ones so long ago passed.",
          "Pass me another Itxi grub.",
          "Your doom is coming, man-things.",
          "Skaven society is a tyranny moderated by assassination.",
          "Yes-yes Warlord Krizk - for a treaty-pledge of just 200 Slaves, 12 claws of warptokens, a Breeder and certain alliances and pledges, one of our very-very finest Clan Moulder Rat Ogres can be yours...",
          "Kill-Kill!",
          "All tunnels lead to Skavenblight",
          "Please, come in and join me for dinner. I can see from the way you dress, you are a man of exquisite...taste",
          "Surrender and serve me in life, or die and slave for me in death.",
          "Awake O Dead, for there can be no rest for ye beneath the earth. Let the splintered bones burrow from the grave pall. Let cold fingers grip time-worn blades, and unseeing eyes survey the fields of slaughter. For your time has come once more. And the dead shall walk.",
          "Athel Loren shall not suffer the presence of Men, nor Orcs, nor Dwarfs, nor Beastmen. If a foe takes a single step upon such sacred soil, they shall not take another.",
          "The new mountains gave us shelter... We made fire in their mouths... The tribes split the lands... The Tyrants roared and fought... There were many kingdoms... It was good for many winters... The tribes grew and grew too much. Now we follow the sun once more...",
          "The Ogres were born long ago... Big, strong and fat... The little round ones by our side... We ate and drank till our guts filled...",
          "Then came the plains and the tribes... Beast, sun, grass, wind, earth... The Sunrisers gave us fire... We fought for them and ate their young...",
          "A great tooth comet came... It grew closer by the day... Fire roared in the sky... Killed the night and drove the beast mad...",
          "The Maw was born from the fire... The earth shook at its coming... The flames ate many tribes... To the mountains some fled...",
          "The hungry flame sat in our guts...We ate the mountains to put it out... but the fire was still there...We climbed further still...We ate the Tall Ones' herds... Cavebeast was good meat... We climbed the peaks... Above the skies the giants dwell...",
          "Thinlings came in great wheel huts... We ate them and took the shinny things..."
        ]
