        "The guy from Labyrinth just turned into a bird!",
        "Revenge like gazpacho soup, is best served cold, precise and merciless.",
        "Augh! Ghost pirate!!",
        "Two heads are better than one!",
        "My name....IS REVENGE!",
        "Go Team Venture!",
        "Sometimes I would pretend I was the Batman",
